import React from "react";

class InterestComponent extends React.Component {
    render(): React.ReactNode {
        return(
            <div className="bg-white w-full flex h-40 mt-2 p-2">
                <div className="flex">
                    <h2>관심정목</h2>
                </div>
            </div>
        );
    }
}

export default InterestComponent;
